import { Image as BaseImage, ImageSlot, } from "@microsoft/fast-components-react-base";
import imageSchema from "./image.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { ImageStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Image = manageJss(ImageStyles)(BaseImage);
export { Image, imageSchema, ImageSlot, };
